import React from 'react';
import Typical from 'react-typical';

const Navbar = () => {
    return (
        <div className="bg-blue-600 text-white py-4 text-center shadow-lg">
            <h1 className="text-3xl font-bold mb-2">Welcome to Study Buddy</h1>
            <Typical
                steps={['We help you find study buddies!', 1000]}
                loop={Infinity}
                wrapper="p"
                className="text-xl"
            />
        </div>
    );
};

export default Navbar;
